/// <summary>
/// Checks whether the <c>AgreementClassificationExtCodeId</c> field is assigned a value if the
/// external code is used for agreement classification.
/// </summary>
/// <returns>
/// true if the <c>AgreementClassificationExtCodeId</c> field is assigned a value if the external code
/// is used for agreement classification; otherwise, false.
/// </returns>
public boolean checkAgreementClassification()
{
    boolean ok = true;

    if (!this.AgreementClassificationExtCodeId
     && this.xmlMapAgreementClassification == XMLMapExternalCode::ExternalCode)
    {
        ok = checkFailed("@SYS332516");
    }

    return ok;
}

