public void initValue()
{
    super();

    this.Defaulting         = NoYes::Yes;
    this.ValidateInput      = NoYes::Yes;
    this.LimitDocuments     = NoYesCombo::Yes;
    this.MaxNoOfDocuments   = 1000;
}

public void insert()
{
    this.removeUnusedValues();

    super();
}

public void modifiedField(fieldId _fieldId)
{
    super(_fieldId);

    switch (_fieldId)
    {
        case fieldNum(AifEndpointActionValueMap, LimitDocuments):
            if (this.LimitDocuments == NoYesCombo::No)
            {
                this.MaxNoOfDocuments = 0;
            }
            else
            {
                this.MaxNoOfDocuments = 1000;
            }
            break;
    }
}

/// <summary>
/// Removes any external codes that are not used.
/// </summary>
public void removeUnusedValues()
{
    if (this.xmlMapCustAccount  != XMLMapExternalCode::ExternalCode)
    {
        this.CustAccountExtCodeId   = '';
    }

    if (this.xmlMapVendAccount  != XMLMapExternalCode::ExternalCode)
    {
        this.VendAccountExtCodeId   = '';
    }

    if (this.xmlMapCurrencyCode != XMLMapCurrencyCode::ExternalCode)
    {
        this.CurrencyExtCodeId      = '';
    }

    if (this.xmlMapDlvTerm  != XMLMapExternalCode::ExternalCode)
    {
        this.DlvTermExtCodeId       = '';
    }

    if (this.xmlMapDlvMode  != XMLMapExternalCode::ExternalCode)
    {
        this.DlvModeExtCodeId       = '';
    }

    if (this.xmlMapMarkup   != XMLMapExternalCode::ExternalCode)
    {
        this.MarkupExtCodeId        = '';
    }

    if (this.xmlMapCountryRegion != XMLMapExternalCode::ExternalCode)
    {
        this.CountryRegionExtCodeId = '';
    }

    if (this.xmlMapState    != XMLMapExternalCode::ExternalCode)
    {
        this.StateExtCodeId         = '';
    }

    if (this.xmlMapCounty   != XMLMapExternalCode::ExternalCode)
    {
        this.CountyExtCodeId        = '';
    }

    if (this.xmlMapZipCode  != XMLMapExternalCode::ExternalCode)
    {
        this.ZipCodeExtCodeId       = '';
    }

    if (this.xmlMapItemId   != XMLMapItemId::ExternalCode)
    {
        this.ItemExtCodeId          = '';
    }
    if (this.xmlMapItemId   != XMLMapItemId::BarCode)
    {
        this.BarCodeSetupId         = '';
        this.BarCodeTypeCodeValue   = '';
    }

    if (this.xmlMapUnitOfMeasureSymbol != XMLMapExternalCode::ExternalCode)
    {
        this.UnitExtCodeId          = '';
    }

    //Remove Intercompany un-used values
    if (this.xmlMapInventLocation != XMLMapExternalCode::ExternalCode)
    {
        this.InventLocationExtCodeId = '';
    }

    if (this.xmlMapTaxCode != XMLMapExternalCode::ExternalCode)
    {
        this.TaxExtCodeId = '';
    }
    if (this.xmlMapAgreementClassification != XMLMapExternalCode::ExternalCode)
    {
        this.AgreementClassificationExtCodeId = '';
    }

    if (this.xmlMapReturnDispCodeId != XMLMapExternalCode::ExternalCode)
    {
        this.ReturnDispCodeExtCodeId = '';
    }

    if (this.xmlMapReturnReasonCodeId != XMLMapExternalCode::ExternalCode)
    {
        this.ReturnReasonCodeExtCodeId = '';
    }
}

public void update()
{
    this.removeUnusedValues();

    super();
}

public boolean validateField(fieldId _fieldId)
{
    boolean ret;

    ret = super(_fieldId);

    switch (_fieldId)
    {
        case fieldNum(AifEndpointActionValueMap,ValidateInput):
            if (!this.ValidateInput)
            {
                warning("@SYS98410");
            }
            break;
        case fieldNum(AifEndpointActionValueMap,Defaulting):
            if (!this.Defaulting)
            {
                warning("@SYS98411");
            }
            break;
    }
    return ret;
}

public boolean validateWrite()
{
    boolean ret;

    ret = super();

    if (!this.checkCust())
    {
        ret = false;
    }

    if (!this.checkVend())
    {
        ret = false;
    }

    if (!this.checkCurrency())
    {
        ret = false;
    }

    if (!this.checkDlvMode())
    {
        ret = false;
    }

    if (!this.checkDlvTerm())
    {
        ret = false;
    }

    if (!this.checkMarkup())
    {
        ret = false;
    }

    if (!this.checkItem())
    {
        ret = false;
    }

    if (!this.checkUnit())
    {
        ret = false;
    }

    if (!this.checkCountryRegion())
    {
        ret = false;
    }

    if (!this.checkState())
    {
        ret = false;
    }

    if (!this.checkCounty())
    {
        ret = false;
    }

    if (!this.checkZipCode())
