    }

    return ret;
}

public static AifEndpointActionValueMap find(
    str        _endpointId,
    str         _actionId,
    boolean             _forUpdate = false)
{
    AifEndpointActionValueMap endpointActionValueMap;

    if (_endpointId && _actionId)
    {
        endpointActionValueMap.selectForUpdate(_forUpdate);

        select firstonly endpointActionValueMap
            where endpointActionValueMap.EndpointId == _endpointId
            &&    endpointActionValueMap.ActionId   == _actionId;
    }

    return endpointActionValueMap;
}

public static AifEndpointActionValueMap findRecId(recId _recId, boolean _forUpdate = false)
{
    AifEndpointActionValueMap aifEndpointActionValueMap;

    if (_recId)
    {
        aifEndpointActionValueMap.selectForUpdate(_forUpdate);

        select firstonly aifEndpointActionValueMap
            where aifEndpointActionValueMap.RecId == _recId;
    }

    return aifEndpointActionValueMap;
}
